                    lat: 59.95,
                    lng: 30.33
                }}
                defaultZoom={11}
                >
                {/* <AnyReactComponent
                    lat={59.955413}
                    lng={30.337844}
                    text="My Marker"
                /> */}
                </GoogleMapReact>
            </div>
        </main>
    )

}
export default Map;
